import React from 'react'
import './LoginSignUp.css'
import { useState } from 'react'
import {Link} from 'react-router-dom'

function LoginSignUp() {

  
  const [values,setValues] = useState({

    fname:'',
    email:'',
    mobile:'',
    fpassword:'',
    cpassword:''
    // fimg:'',
    // seventimg:'',
    // eightAimg:''
  
  })

  const navigate = useNavigate();

  function handleSubmit(e){
     
    e.preventDefault();
    axios.post("http://localhost:4500/reg/",values)
    .then(res=>{

      console.log(res);
      alert("registration sucessful")
      navigate('/');
    })
    .catch(err=>console.log(err))
  }





  return (
    <div className='loginsignup'>
      
      <div className='loginsignup-container'>

        <h1>Sign Up</h1>
        <div className='loginsignup-fields'>

          <input type='text' placeholder='Your Name'/>
          <input type='email' placeholder='Email Address'/>
          <input type='mobile' placeholder='Email Address'/>
          <input type='password' placeholder='Email Address'/>
          <input type='password' placeholder='Email Address'/>
          <input type='file' placeholder='Email Address'/>
          <input type='file' placeholder='Email Address'/>
         
         
          <input type='file' placeholder='Password'/>

        </div>
        <button>Continue</button>
        <p className='loginsignup-login'>Already have an account? <span><Link to='/login'>Login here</Link></span></p>

        <div className='loginsignip-agree'>
            <input type='checkbox' name='' id=''/>
            <p>By continuing i agree to terms of use & privacy policy.</p>
        </div>

      </div>
    </div>
  )
}

export default LoginSignUp
